import styled from "styled-components";

const StyledRoom = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 200px;
  border-style: solid;
  border-color: #bfbfbf;
  font-size: 1em;
  border-radius: 5px;
`;

export default StyledRoom;
